import React from "react";
import styles from './Header.module.scss'

const HeaderButton = (props) => {
    return(
        <p className={styles.Header__ButtonsBlock__Text}>
            <a href="#" className={styles.Header__ButtonsBlock__Text__Link}>{props.text}</a>
        </p>
    )
}

export {HeaderButton}
